import axios from 'axios';
import React, { useEffect, useState } from 'react';

const Vehicle = () => {
    const [data,setData]=useState();

    //Calling the Api 
    useEffect( async ()=>{
        try{
        let response = await axios.get('https://devapi.pikpart.com/api/vehicle/models');
        setData(response?.data?.data)

        }
        catch(err){
            <h1>{err}</h1>
        }
    },[])

    


    return (
        <>
            <div className="container text-center">
                <h3 className="text-primary">PikPart</h3>
            </div>
            <div className="card text-center" style={{width:"60%",marginLeft:"20%",marginRight:"20%"}}>
                <div className="header bg-primary">
                    <h5 className="text-light">Vehicle List</h5>
                </div>
                <div className="card-body">
                    {data?.map((val)=>{
                        return (
                            <div>
                                {val.id}
                                <button className="btn-warning">Update</button>
                            </div>
                        )
                    })}
                </div>
            </div>
        </>
    );
};

export default Vehicle;
